import { Link } from 'react-router-dom';
import styles from './'

const NotFound = () => {
  return (
    <div>
      <h2>404 - Not Found</h2>
      <p>Sorry, the page you are looking for might be in another castle.</p>
      <Link to="/">Go Home</Link>
    </div>
  );
};

export default NotFound;
